import './App.css';
import Navbar from './components/Navbar';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Router>
        <Navbar />
        <Switch>
          {/* Define a component to render when the route is '/' */}
          <Route path='/' exact>
            <h2>Home Page</h2>
          </Route>
        </Switch>
        <h2>Hello</h2>
      </Router>
    </div>
  );
}

export default App;
